import React from 'react';
import '../styles/Home.css'; // Import styles for Home page

const Home: React.FC = () => {
  return (
    <section>
      <h1>Welcome to My Portfolio</h1>
      <p>Explore the pages to know more about me and my work.</p>
    </section>
  );
}

export default Home;
